missbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",ncc='Dienstag',sxc='Dimension',qjc='Dimension [height=',Itc='DirectionalTextHelper',Dcc='Do',wcc='Do.',Ltc='DockLayoutPanel',Mtc='DockLayoutPanel$Direction',Ntc='DockLayoutPanel$Direction;',Qtc='DockLayoutPanel$DockAnimateCommand',Otc='DockLayoutPanel$LayoutData',Upc='DomEvent',Zpc='DomEvent$Type',pcc='Donnerstag',awc='Double',ogc='EAST',y9b='EEE, d MMM yyyy HH:mm:ss Z',fmc='EEE. dd MMM. yyyy HH:mm:ss',S9b='EEEE d. MMMM',B9b='EEEE, d. MMMM y',W7b='EM',tec='EMPTY',yec='ENABLED',Qcc='END',Y7b='EX',osc='ElementMapperImpl',psc='ElementMapperImpl$FreeNode',Qbc='English',epc='Enum',Hbc='Etc/GMT',Jbc='Etc/GMT+',Ibc='Etc/GMT-',o8b='Event type',gvc='Event$NativePreviewEvent',kqc='EventBus',uoc='EventObject',zoc='Exception',Xec='Expecting version 6 from server, got ',k9b='F',okc='F8834F07517EF3B7D02B9E845E5E1B88',R7b='FIXED',tfc='FLOAT',Yj
